import  './styles_components/services.css';

function Services(){
    return(
                <div id="Service">
                    <div></div>
                    <h2>Services</h2>
                    <div id="rectangle-services">
                        <div id="service-desktop"></div>
                        <div id="service-mobile"></div>
                    </div>

                </div>
    );
}
export default Services;
